import React from 'react'
import landingVideo from "";

const LandingPage = () => {
    return (
        <div>
            <div className='video'>
                
                    <video autoPlay loop muted playsInline >
                        <source src="/LandingPage/landing-video.mp4" type="video/mp4"/>
                    </video>
                </div>
            <h1>jnhbgvfd</h1>
        </div>
    )
}

export default LandingPage
